import React from "react";

function Header() {
  return (
    <header>
    <h1>Portfolio</h1>
    <h2>Home</h2>

    <h2>About</h2>

    <h2>Projects</h2>


    <h2>Contact</h2>
    </header>
  );
}

export default Header;
